Record types are types that contain other types as named fields. Sometimes also called struct or product types. type User { name string age int
} // Construct a new record of type `User`
fn main = { User | name = "Jonas", age = 25 } // Construct a new record of type `User`
// // this time the type is inferred from the field names in scope
// instead of explicitly annotated. fn main = { name = "Jonas", age = 25 } Defining and constructing a record Modifying Records Records can also be constructed by changing some fields of an existing record. But remember! Lumina is an immutable language, so this creates a new record while keeping the previous record the same. fn rename user new as User, string -> User = { user ~ name = new } // Is equivalent to: fn rename user new as User, string -> User = { User | name = new, age = user.age } Function returning a copy of a user with its name substituted

