Sum types are types whose value is one out of a set of possible variants. Sometimes called enum types. // Define a sum-type whose value can be one of `Admin`, `Client` or `Guest`
type UserKind = Admin | Client | Guest // Construct a new sum-type of type `UserKind`
fn main = Admin Variants of sum types can also have parameters of other types. type UserKind = Admin Department | Client Company | Guest type Department = Accounting | Support type Company { name string
} fn main = Admin Accounting // or perhaps ... fn main = Client { Company | name = "luminalang" }

